import React from "react";
import TextPicture from "../textpicture/textpicture";

export default function SearchColumn(){
    return (
        <div className="search-items">
            <TextPicture 
                text='Search Item' pic='search.png' 
                containerClass='search-header'
                textClass= 'search-heading'
                picClass='search-img'
            />
            <div className="search-header">
                <img src="search.png" className="search-img"/>
                <span className="search-heading">Search Item</span>
            </div>
        </div>
    )
}
